import { FriendList } from "./FriendList";
import css from './FriendList.module.css';


export const FriendListItems = ({ friends }) => {
    return (
        <ul>
            {friends.map(friend =>
                <li className={css.item} key={friend.id}>
                    <FriendList friend={friend}/>
                </li> )}
        </ul>
    )
}
